class Solution:
    def minDominoRotations(self, A, B):
        # try to rotate first char
        if len(A) != len(B):
            return -1
        matchA = self.count(A, B)
        matchB = self.count(B, A)
        if matchA == -1:
            return matchB
        elif matchB == -1:
            return matchA
        return min(matchA, matchB)

    def count(self, A, B):
        size = len(A)
        rotateA = 0
        rotateB = 0
        for i in range(size):
            if A[i] != A[0] and B[i] != A[0]:
                return -1
            if A[i] != A[0]:
                rotateA += 1
            elif B[i] != A[0]:
                rotateB += 1
        # I need to rotate both to A or to B
        # I cannot do min(rotateA, size - rotateB)
        # because we could have same elements on both A[i] and B[i]
        return min(rotateA, rotateB)

